public class Solution {
    public int maxAreaOfIsland(int[][] grid) {
        if (grid == null || grid.length == 0) {
            return 0;
        }

        int n = grid.length;
        Map<Integer, Integer> parent = new HashMap<>();
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    parent.put(i * n + j, i * n + j);
                }
            }
        }

        int maxArea = 0;
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    int root = findRoot(parent, i * n + j);
                    int area = dfs(grid, parent, root, n);
                    maxArea = Math.max(maxArea, area);
                }
            }
        }

        return maxArea;
    }

    private int findRoot(Map<Integer, Integer> parent, int x) {
        if (parent.get(x) != null && parent.get(x) != x) {
            parent.put(x, findRoot(parent, parent.get(x)));
        }
        return parent.getOrDefault(x, x);
    }

    private int dfs(int[][] grid, Map<Integer, Integer> parent, int root, int n) {
        if (root < 0 || root >= n * n || grid[root / n][root % n] == 0) {
            return 0;
        }

        grid[root / n][root % n] = 0;
        int area = 1;
        for (int[] dir : new int[][]{{-1, 0}, {1, 0}, {0, -1}, {0, 1}}) {
            int newX = root / n + dir[0];
            int newY = root % n + dir[1];
            if (newX >= 0 && newX < n && newY >= 0 && newY < n && grid[newX][newY] == 1) {
                int newRoot = findRoot(parent, newX * n + newY);
                if (newRoot != root) {
                    parent.put(root, newRoot);
                    area += dfs(grid, parent, newRoot, n);
                }
            }
        }

        return area;
    }
}

