import java.util.Arrays;

public class Solution {
    public double new21Game(int n, int k, int w) {
        if (k == 0) {
            return (n % w == 0) ? 1.0 : 0.0;
        }

        double[] dp = new double[n + 1];
        Arrays.fill(dp, 0);
        dp[0] = 1;

        for (int i = 1; i < k; i++) {
            dp[i] = 1 / w;
        }

        for (int i = k; i <= n; i++) {
            if (i < k) {
                dp[i] = 1 / w;
            } else {
                double sum = 0.0;
                for (int j = 1; j <= Math.min(w, i - k); j++) {
                    sum += dp[i - j];
                }
                dp[i] = sum / w;
            }
        }

        return dp[n];
    }
}

