public class Solution {
    public List<String> findAndReplacePattern(String[] words, String pattern) {
        Map<Character, Character> map = new HashMap<>();
        Map<Character, Character> revMap = new HashMap<>();

        List<String> result = new ArrayList<>();

        for (String word : words) {
            if (match(word, pattern, map, revMap)) {
                result.add(word);
            }
        }

        return result;
    }

    private boolean match(String word, String pattern, Map<Character, Character> map, Map<Character, Character> revMap) {
        if (map.size() != pattern.length()) {
            for (int i = 0; i < pattern.length(); i++) {
                char pChar = pattern.charAt(i);
                char wChar = word.charAt(i);

                if (!map.containsKey(pChar)) {
                    map.put(pChar, wChar);
                    revMap.put(wChar, pChar);
                } else if (map.get(pChar) != wChar) {
                    return false;
                }
            }

            return true;
        }

        for (int i = 0; i < pattern.length(); i++) {
            char pChar = pattern.charAt(i);
            char wChar = word.charAt(i);

            if (!map.containsKey(pChar) || map.get(pChar) != wChar) {
                return false;
            }
        }

        return true;
    }
}

