        for (String word : words) {
            int i = 0;
            while (i < word.length()) {
                String prefix = word.substring(i);
                if (!map.containsKey(prefix)) {
                    map.put(prefix, 1);
                } else {
                    map.put(prefix, map.get(prefix) + 1);
                }
                i++;
            }
        }

        int res = 0;
        for (Map.Entry<String, Integer> entry : map.entrySet()) {
