public class Solution {
    public int[] hitBricks(int[][] grid, int[][] hits) {
        int m = grid.length;
        int n = grid[0].length;
        int[] result = new int[hits.length];

        for (int i = 0; i < hits.length; i++) {
            boolean changed = false;
            int row = hits[i][0], col = hits[i][1];

            if (row < 0 || row >= m || col < 0 || col >= n) continue;

            grid[row][col] = 0;

            for (int j = 0; j < m; j++) {
                for (int k = 0; k < n; k++) {
                    if (grid[j][k] == 1 && dfs(grid, j, k)) {
                        changed = true;
                    }
                }
            }

            result[i] = changed ? 1 : 0;
        }

        return result;
    }

    private boolean dfs(int[][] grid, int row, int col) {
        if (row < 0 || row >= grid.length || col < 0 || col >= grid[0].length || grid[row][col] == 0) return false;

        grid[row][col] = 0;

        for (int i = -1; i <= 1; i++) {
            for (int j = -1; j <= 1; j++) {
                if (i == 0 && j == 0) continue;

                int r = row + i, c = col + j;

                if (r >= 0 && r < grid.length && c >= 0 && c < grid[0].length && grid[r][c] == 1) {
                    return true;
                }
            }
        }

        return false;
    }
}

