import com_github_leetcode.TreeNode;

public class Solution {
    public TreeNode subtreeWithAllDeepest(TreeNode root) {
        int maxDepth = findMaxDepth(root);
        return findSubtree(root, maxDepth);
    }

    private int findMaxDepth(TreeNode node) {
        if (node == null) {
            return 0;
        }
        int leftDepth = findMaxDepth(node.left);
        int rightDepth = findMaxDepth(node.right);
        return Math.max(leftDepth, rightDepth) + 1;
    }

    private TreeNode findSubtree(TreeNode root, int maxDepth) {
        if (root == null || root.val != maxDepth) {
            return null;
        }
        if (isLeaf(root)) {
            return root;
        }
        TreeNode left = findSubtree(root.left, maxDepth);
        TreeNode right = findSubtree(root.right, maxDepth);
        if (left != null && right != null) {
            return root;
        } else if (left != null) {
            return left;
        } else {
            return right;
        }
    }

    private boolean isLeaf(TreeNode node) {
        return node.left == null && node.right == null;
    }
}

