                    i++;
                }
                if (i > left) {
                    for (int j = left; j < i; j++) {
                        res[j] = 'R';
                    }
                } else {
                    break;
                }
            }

            if (res[right] == '.') {
                int i = right - 1;
                while (i >= 0 && res[i] == '.') {
                    i--;
                }
                if (i < right) {
                    for (int j = i + 1; j <= right; j++) {
                        res[j] = 'L';
                    }
                } else {
                    break;
                }
            }

            left++;
            right--;
        }

        return new String(res);
    }
}

