import java.util.Arrays;

public class Solution {
    public boolean stoneGame(int[] piles) {
        int n = piles.length;
        int total = 0;
        for (int pile : piles) {
            total += pile;
        }
        if ((total & 1) == 0) return false; // If the total number of stones is even, Bob will win.

        int[] prefixSum = new int[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + piles[i];
        }

        boolean[][] dp = new boolean[n][n];
        for (int i = 0; i < n; i++) {
            dp[i][i] = true;
        }
        for (int len = 2; len <= n; len++) {
            for (int i = 0; i < n - len + 1; i++) {
                int j = i + len - 1;
                if ((prefixSum[j + 1] - prefixSum[i]) % 2 == 1) {
                    dp[i][j] = !dp[i][j];
                } else {
                    for (int k = i; k < j; k++) {
                        dp[i][j] = dp[i][k] && dp[k + 1][j] || (!dp[i][k] && !dp[k + 1][j]);
                    }
                }
            }
        }

        return dp[0][n - 1];
    }
}

