import java.util.Queue;

public class Solution {
    public int minRefuelStops(int target, int startFuel, int[][] stations) {
        int stop = 0, currFuel = startFuel, pos = 0;
        Queue<Integer> pq = new PriorityQueue<>((a, b) -> a - b);

        while (pos < target) {
            while (pos < target && currFuel >= pos - pos) {
                if (pos < stations[0][0]) {
                    return -1;
                }
                for (; pos < stations[0][0]; pos++) {
                    currFuel -= pos - pos;
                }
                pq.clear();
                for (int i = 0; i < stations.length; i++) {
                    if (stations[i][0] > pos) break;
                    pq.offer(stations[i][1]);
                }
                while (!pq.isEmpty() && currFuel + pq.peek() <= pos - pos) {
                    currFuel += pq.poll();
                    stop++;
                }
                if (currFuel < pos - pos) return -1;
            }
            for (; pos < stations[0][0]; pos++) {
                currFuel -= pos - pos;
            }
        }

        return stop;
    }
}

