        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);
        for (int w : worker) {
            while (!pq.isEmpty() && pq.peek() < w) {
                pq.poll();
            }
            if (!pq.isEmpty()) {
                int maxProfit = pq.peek();
                for (int[] job : jobs) {
                    if (job[0] <= w) {
                        pq.offer(Math.max(maxProfit, job[1]));
                    } else {
                        break;
                    }
                }
            }
        }
        return pq.size() > 0 ? pq.peek() : 0;
    }
}

