public class Solution {
    public int minEatingSpeed(int[] piles, int h) {
        int left = 1;
        int right = (int) Math.max(0, (long) Arrays.stream(piles).sum()) / h;

        while (left < right) {
            int mid = (left + right) / 2;

            if (!canEatAllInHHours(mid, piles)) {
                left = mid + 1;
            } else {
                right = mid;
            }
        }

        return left;
    }

    private boolean canEatAllInHHours(int k, int[] piles) {
        int hours = 0;
        for (int pile : piles) {
            hours += (pile - 1) / k + 1;
        }
        return hours <= 24; // assuming h is 24
    }
}

