import com_github_leetcode.TreeNode;
import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<Integer> distanceK(TreeNode root, int target, int k) {
        if (root == null) return new ArrayList<>();

        List<Integer> result = new ArrayList<>();
        Map<TreeNode, Integer> parentMap = new HashMap<>();
        dfs(root, null, parentMap);

        Queue<TreeNode> queue = new LinkedList<>();
        queue.offer(new TreeNode(target));
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                TreeNode node = queue.poll();
                if (node.left != null) queue.offer(node.left);
                if (node.right != null) queue.offer(node.right);
                if (k == 0) result.add(node.val);
                else if (k > 0) {
                    if (parentMap.containsKey(node)) {
                        result.add(node.val);
                        k--;
                    } else queue.poll();
                }
            }
        }

        return result;
    }

    private void dfs(TreeNode node, TreeNode parent, Map<TreeNode, Integer> map) {
        if (node == null) return;
        map.put(node, parent != null ? 1 : 0);
        if (parent != null) map.put(parent, map.getOrDefault(parent, 0) + 1);
        if (node.left != null) dfs(node.left, node, map);
        if (node.right != null) dfs(node.right, node, map);
    }
}

