public class Solution {
    public int distinctSequences(int n) {
        final int MOD = 1000000007;
        long[] dp = new long[n + 1];
        Arrays.fill(dp, 0);
        dp[0] = 1;

        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= 6 && i - j >= 0; j++) {
                if ((i - j) % 2 == 0 || gcd(j, i - j) != 1) continue;
                dp[i] += dp[i - j];
                dp[i] %= MOD;
            }
        }

        return (int)dp[n];
    }

    public int gcd(int a, int b) {
        if (b == 0) return a;
        return gcd(b, a % b);
    }
}

