import java.math.BigInteger;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int numberOfWays(int startPos, int endPos, int k) {
        BigInteger MOD = new BigInteger("1000000007");
        Map<Integer, BigInteger> dp = new HashMap<>();
        dp.put(0, BigInteger.ONE);
        for (int i = 1; i <= k; i++) {
            Map<Integer, BigInteger> temp = new HashMap<>();
            for (Map.Entry<Integer, BigInteger> entry : dp.entrySet()) {
                int pos = entry.getKey();
                BigInteger ways = entry.getValue();
                if (pos - 1 >= startPos && pos - 1 + i <= endPos) {
                    temp.put(pos - 1, temp.getOrDefault(pos - 1, BigInteger.ZERO).add(ways));
                }
                if (pos + 1 >= startPos && pos + 1 + i <= endPos) {
                    temp.put(pos + 1, temp.getOrDefault(pos + 1, BigInteger.ZERO).add(ways));
                }
            }
            dp = temp;
        }
        return dp.get(endPos - startPos).mod(MOD).intValue();
    }
}

