import java.util.Arrays;

public class Solution {
    public int minPathCost(int[][] grid, int[][] moveCost) {
        int m = grid.length;
        int n = grid[0].length;
        int[] dp = new int[m * n];
        Arrays.fill(dp, Integer.MAX_VALUE);
        dp[grid[0][0]] = 0;

        for (int i = 1; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (j == 0) {
                    dp[i * n + j] = Math.min(dp[(i - 1) * n + j], dp[(i - 1) * n + n - 1]) + moveCost[grid[i - 1][j]][j];
                } else if (j == n - 1) {
                    dp[i * n + j] = Math.min(dp[(i - 1) * n + j], dp[(i - 1) * n + 0]) + moveCost[grid[i - 1][j]][j];
                } else {
                    dp[i * n + j] = Math.min(Math.min(dp[(i - 1) * n + j], dp[(i - 1) * n + j - 1]), dp[(i - 1) * n + j + 1]) + moveCost[grid[i - 1][j]][j];
                }
            }
        }

        int minCost = Integer.MAX_VALUE;
        for (int i = 0; i < n; i++) {
            minCost = Math.min(minCost, dp[m * n - 1] - grid[0][i]);
        }

        return minCost;
    }
}

