import java.util.BitSet;
public class Solution {
    public int shortestSequence(int[] rolls, int k) {
        BitSet seen = new BitSet(k);
        for (int roll : rolls) {
            seen.set(roll - 1);
        }
        int sequenceLength = 0;
        while (!seen.get(0)) {
            seen.set(0);
            sequenceLength++;
        }
        for (int i = 1; i < k; i++) {
            if (!seen.get(i)) {
                seen.set(i);
                sequenceLength++;
            }
        }
        return sequenceLength;
    }
}

