import java.util.Arrays;

public class Solution {
    public int closestMeetingNode(int[] edges, int node1, int node2) {
        int n = edges.length;
        Arrays.fill(edges, -1);
        for (int i = 0; i < n; i++) {
            if (edges[i] == -1) continue;
            edges[edges[i]] = i;
        }

        int[] dist1 = new int[n];
        int[] dist2 = new int[n];
        Arrays.fill(dist1, Integer.MAX_VALUE);
        Arrays.fill(dist2, Integer.MAX_VALUE);
        dist1[node1] = 0;
        dist2[node2] = 0;

        for (int i = node1; i != -1; i = edges[i]) {
            if (dist1[i] < Integer.MAX_VALUE) continue;
            dist1[i] = dist1[i - 1] + 1;
        }
        for (int i = node2; i != -1; i = edges[i]) {
            if (dist2[i] < Integer.MAX_VALUE) continue;
            dist2[i] = dist2[i - 1] + 1;
        }

        int res = -1;
        int minDist = Integer.MAX_VALUE;
        for (int i = 0; i < n; i++) {
            if (dist1[i] == Integer.MAX_VALUE || dist2[i] == Integer.MAX_VALUE) continue;
            int d = Math.max(dist1[i], dist2[i]);
            if (d < minDist) {
                minDist = d;
                res = i;
            }
        }

        return res;
    }
}

