public class Solution {
    public int distributeCookies(int[] cookies, int k) {
        int n = cookies.length;
        long sum = 0;
        for (int cookie : cookies) {
            sum += cookie;
        }

        int minUnfairness = (int)1e9;
        for (int i = 0; i < (1 << k); i++) {
            long unfairness = 0;
            long total = 0;
            for (int j = 0; j < k; j++) {
                if (((i >> j) & 1) == 1) {
                    total += cookies[j];
                } else {
                    unfairness += total;
                    total = 0;
                }
            }
            unfairness += total + sum - total;
            minUnfairness = Math.min(minUnfairness, (int)unfairness);
        }

        return minUnfairness;
    }
