import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    private static final int MOD = 1000000007;

    public int countPaths(int[][] grid) {
        int m = grid.length, n = grid[0].length;
        int[][] dp = new int[m][n];
        Map<String, Integer> memo = new HashMap<>();

        for (int i = 0; i < m; i++) {
            Arrays.fill(dp[i], -1);
        }

        function(grid, dp, memo);

        int count = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (dp[i][j] != -1) {
                    count += dp[i][j];
                }
            }
        }

        return count % MOD;
    }

    private void function(int[][] grid, int[][] dp, Map<String, Integer> memo) {
        int m = grid.length, n = grid[0].length;

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    String s = i + "," + j;
                    if (!memo.containsKey(s)) {
                        memo.put(s, dfs(grid, dp, i, j));
                    }
                    dp[i][j] = memo.get(s);
                }
            }
        }
    }

    private int dfs(int[][] grid, int[][] dp, int i, int j) {
        int m = grid.length, n = grid[0].length;

        if (i < 0 || i >= m || j < 0 || j >= n || grid[i][j] == 0) {
            return 1;
        }

        if (dp[i][j] != -1) {
            return dp[i][j];
        }

        int count = 0;
        for (int x = -1; x <= 1; x++) {
            for (int y = -1; y <= 1; y++) {
                if ((x == 0 && y == 0) || Math.abs(x) + Math.abs(y) != 1) {
                    continue;
                }

                int newX = i + x, newY = j + y;
                if (newX >= 0 && newX < m && newY >= 0 && newY < n && grid[newX][newY] == 1) {
                    count += dfs(grid, dp, newX, newY);
                }
            }
        }

        return count % MOD;
    }
}

