public class Solution {
    public int minimumScore(int[] nums, int[][] edges) {
        List<Integer>[] graph = new List[nums.length];
        for (int i = 0; i < nums.length; i++) {
            graph[i] = new ArrayList<>();
        }
        for (int[] edge : edges) {
            graph[edge[0]].add(edge[1]);
