        }

        int totalXOR = 0;
        for (int num : nums) {
            totalXOR ^= num;
        }

        int minScore = Integer.MAX_VALUE;

        for (int i = 0; i < nums.length; i++) {
            boolean[] visited = new boolean[nums.length];
            int xor1 = dfs(graph, i, visited, totalXOR);
            Arrays.fill(visited, false);
            int xor2 = dfs(graph, i, visited, totalXOR);
            minScore = Math.min(minScore, Math.abs(xor1 - xor2));
        }

        return minScore;
    }

    private int dfs(List<Integer>[] graph, int node, boolean[] visited, int totalXOR) {
        if (visited[node]) {
            return 0;
        }
        visited[node] = true;

        int xor = totalXOR ^ nums[node];
        for (int neighbor : graph[node]) {
            xor ^= dfs(graph, neighbor, visited, totalXOR);
        }

        return xor;
    }
}

