import java.util.Arrays;
import java.util.PriorityQueue;

class Solution {
    static class UF {
        int[] parent;
        int[] rank;
        int n;

        public UF(int n) {
            this.n = n;
            parent = new int[n];
            rank = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
                rank[i] = 0;
            }
        }

        public void union(int x, int y) {
            if (rank[x] > rank[y]) {
                parent[y] = x;
            } else {
                parent[x] = y;
                if (rank[x] == rank[y]) {
                    rank[y]++;
                }
            }
        }

        public boolean connected(int x, int y) {
            return find(x) == find(y);
        }

        public int find(int x) {
            if (parent[x] != x) {
                parent[x] = find(parent[x]);
            }
            return parent[x];
        }
    }

    public int[] maxSumAfterRemoving(int n, int[][] removeQueries) {
        UF uf = new UF(n);
        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);

        for (int i = 0; i < n; i++) {
            pq.add(i);
        }

        int[] answer = new int[removeQueries.length];
        for (int i = 0; i < removeQueries.length; i++) {
            int index = removeQueries[i][1];
            uf.union(pq.peek(), index);
            pq.poll();
            if (!uf.connected(0, pq.peek())) {
                pq.add(index);
            }
            answer[i] = Arrays.stream(Arrays.copyOfRange(pq.toArray(), 0, pq.size())).mapToInt(Integer::intValue).sum();
        }

        return answer;
    }
}

