import java.util.*;

public class Solution {
    public int longestCycle(int[] edges) {
        int n = edges.length;
        List<Integer>[] graph = new List[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }

        for (int i = 0; i < n; i++) {
            if (edges[i] != -1) {
                graph[edges[i]].add(i);
            }
        }

        int maxCycleLength = 0;
        for (int i = 0; i < n; i++) {
            if (!graph[i].isEmpty()) {
                boolean[] visited = new boolean[n];
                int cycleLength = dfs(graph, i, -1, visited, 0);
                maxCycleLength = Math.max(maxCycleLength, cycleLength);
            }
        }

        return maxCycleLength;
    }

    private int dfs(List<Integer>[] graph, int node, int parent, boolean[] visited, int length) {
        if (visited[node]) {
            return length;
        }
        visited[node] = true;
        for (int neighbor : graph[node]) {
            if (neighbor == parent) {
                continue;
            }
            int cycleLength = dfs(graph, neighbor, node, visited, length + 1);
            if (cycleLength != -1) {
                return cycleLength;
            }
        }
        return -1;
    }
}

