import java.util.Arrays;
import java.util.PriorityQueue;

public class Solution {
    public long minSumSquareDiff(int[] nums1, int[] nums2, int k1, int k2) {
        int n = nums1.length;
        int[] diff = new int[n];
        for (int i = 0; i < n; i++) {
            diff[i] = Math.abs(nums1[i] - nums2[i]);
        }
        Arrays.sort(diff);

        long totalDifferences = 0;
        for (int i = 0; i < n; i++) {
            totalDifferences += (long) diff[i];
        }

        if (k1 + k2 < totalDifferences) {
            return -1;
        }

        PriorityQueue<Integer> queue = new PriorityQueue<>((a, b) -> b - a);
        for (int i = 0; i < n; i++) {
            if (diff[i] > 0 && k1 + k2 >= diff[i]) {
                queue.add(diff[i]);
            } else {
                break;
            }
        }

        long res = 0;
        while (!queue.isEmpty()) {
            int cur = queue.poll();
            if (k1 + k2 - cur >= 0) {
                res += (long) cur * cur;
                k1 += cur;
                k2 -= cur;
            } else {
                res += (long) cur * cur;
                break;
            }
        }

        return res;
    }
}

