public class Solution {
    public long sellingWood(int m, int n, int[][] prices) {
        long[][] dp = new long[m + 1][n + 1];
        for (int[] price : prices) {
            Arrays.fill(dp[price[0]], Integer.MAX_VALUE / 2);
            Arrays.fill(dp[price[0]][], Integer.MAX_VALUE / 2);
        }
        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                if (i == 1 || j == 1) {
                    dp[i][j] = prices[0][2];
                } else {
