import java.util.ArrayList;
import java.util.HashMap;
import java.util.LinkedList;
import java.util.List;
import java.util.Map;
import java.util.Queue;

public class Solution {
    public int[][] buildMatrix(int k, int[][] rowC, int[][] colC) {
        if (rowC.length + colC.length < k) {
            return new int[0][];
        }

        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 1; i <= k; i++) {
            map.put(i, -1);
        }

        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            graph.add(new ArrayList<>());
        }

        int[] indegree = new int[k + 1];
        for (int i = 0; i < rowC.length; i++) {
            int above = rowC[i][0], below = rowC[i][1];
            if (above > 0) {
                graph.get(above - 1).add(below);
                indegree[below]++;
            }
        }

        for (int i = 0; i < colC.length; i++) {
            int left = colC[i][0], right = colC[i][1];
            if (left > 0) {
                graph.get(left - 1).add(right);
                indegree[right]++;
            }
        }

        Queue<Integer> queue = new LinkedList<>();
        for (int i = 1; i <= k; i++) {
            if (indegree[i] == 0) {
                queue.add(i);
            }
        }

        List<Integer> order = new ArrayList<>();
        while (!queue.isEmpty()) {
            int node = queue.poll();
            order.add(node);

            for (int neighbor : graph.get(node - 1)) {
                indegree[neighbor]--;
                if (indegree[neighbor] == 0) {
                    queue.add(neighbor);
                }
            }
        }

        if (order.size() != k) {
            return new int[0][];
        }

        int[][] matrix = new int[k][k];
        for (int i = 0; i < k; i++) {
            map.put(order.get(i), i);
        }

        for (int i = 1; i <= k; i++) {
            graph.get(map.get(i) - 1).clear();
        }

        for (int i = 0; i < rowC.length; i++) {
            int above = rowC[i][0], below = rowC[i][1];
            if (above > 0) {
                matrix[map.get(above) - 1][map.get(below)] = 1;
            }
        }

        for (int i = 0; i < colC.length; i++) {
            int left = colC[i][0], right = colC[i][1];
            if (left > 0) {
                matrix[map.get(left) - 1][map.get(right)] = 1;
            }
        }

        return matrix;
    }
}

