import java.util.*;

public class Solution {
    public int maximumXOR(int[] nums) {
        TrieNode root = new TrieNode();
        for (int num : nums) {
            TrieNode current = root;
            for (int i = 31; i >= 0; i--) {
                int bit = ((num >> i) & 1);
                if (!current.hasBit(bit)) {
                    current.setBit(bit);
                    current.next[bit] = new TrieNode();
                }
                current = current.next[bit];
            }
        }

        int max_xor = 0;
        for (int num : nums) {
            TrieNode current = root;
            int xor = 0;
            for (int i = 31; i >= 0; i--) {
                int bit = ((num >> i) & 1);
                int oppositeBit = 1 - bit;
                if (current.hasBit(oppositeBit)) {
                    xor |= (1 << i);
                    current = current.next[oppositeBit];
                } else {
                    current = current.next[bit];
                }
            }
            max_xor = Math.max(max_xor, xor);
        }

        return max_xor;
    }

    private class TrieNode {
        boolean hasBit(int bit) {
            return next[bit] != null;
        }

        void setBit(int bit) {
            if (next[bit] == null) {
                next[bit] = new TrieNode();
            }
        }

        int[] next = new int[2];
    }
}

