            for (String num : trimmedNums) {
                if (pq.size() <= queries[i][1]) {
                    pq.offer(num);
                } else {
                    if (!pq.peek().equals(num)) {
                        pq.poll();
                        pq.offer(num);
                    }
                }
            }

            answer[i] = Integer.parseInt(pq.peek()) - 1;
        }

        return answer;
    }
}

