                    count++;
                }
            }
        }
        return count;
    }

    public int gcd(List<Integer> list) {
        int result = list.get(0);
        for (int i = 1; i < list.size(); i++) {
            while (list.get(i) % result != 0) {
                int temp = result;
                result = list.get(i);
                list.set(i, temp);
            }
        }
        return result;
    }
}

