import com_github_leetcode.TreeNode;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int[] treeQueries(TreeNode root, int[] queries) {
        Map<Integer, Integer> parent = new HashMap<>();
        Map<Integer, Integer> heightMap = new HashMap<>();
        Map<Integer, Integer> childCountMap = new HashMap<>();

        dfs(root, null, parent, heightMap, childCountMap);

        int[] answer = new int[queries.length];
        for (int query : queries) {
            TreeNode node = root;
            while (node.val != query) {
                if (parent.get(node.val) == 1) {
                    node = node.left;
                } else {
                    node = node.right;
                }
            }

            int height = heightMap.getOrDefault(query, -1);
            int childCount = childCountMap.getOrDefault(query, 0);

            TreeNode parentNode = null;
            if (node.val * 2 <= query) {
                parentNode = node.left;
            } else {
                parentNode = node.right;
            }

            while (parentNode != null) {
                heightMap.put(parentNode.val, heightMap.getOrDefault(parentNode.val, 0) + 1);
                childCountMap.put(parentNode.val, childCountMap.getOrDefault(parentNode.val, 0) - 1);
                parentNode = parent.get(parentNode.val) == 1 ? parentNode.left : parentNode.right;
            }

            answer[queries.length - queries.indexOf(query)] = height + 1;

            node = root;
            while (node.val != query) {
                if (parent.get(node.val) == 1) {
                    node = node.left;
                } else {
                    node = node.right;
                }
            }

            parentNode = null;
            if (node.val * 2 <= query) {
                parentNode = node.left;
            } else {
                parentNode = node.right;
            }

            while (parentNode != null) {
                heightMap.put(parentNode.val, heightMap.getOrDefault(parentNode.val, 0) - 1);
                childCountMap.put(parentNode.val, childCountMap.getOrDefault(parentNode.val, 0) + 1);
                parentNode = parent.get(parentNode.val) == 1 ? parentNode.left : parentNode.right;
            }
        }

        return answer;
    }

    private void dfs(TreeNode node, Integer parent, Map<Integer, Integer> parentMap, Map<Integer, Integer> heightMap, Map<Integer, Integer> childCountMap) {
        if (node == null) {
            return;
        }

        parentMap.put(node.val, parent);
        childCountMap.put(node.val, (childCountMap.getOrDefault(node.val, 0) + (node.left != null ? 1 : 0) + (node.right != null ? 1 : 0)));

        if (parent == null) {
            heightMap.put(node.val, 0);
        } else {
            int parentHeight = heightMap.get(parent);
            heightMap.put(node.val, parentHeight + 1);
        }

        dfs(node.left, node.val, parentMap, heightMap, childCountMap);
        dfs(node.right, node.val, parentMap, heightMap, childCountMap);
    }
}

