import java.util.Arrays;
import java.util.List;

public class Solution {
    public long minimumTotalDistance(List<Integer> robot, int[][] f) {
        // sort factories :
        // 1. move all factories with 0-capacity to the end
        // 2. sort everything else by x-position in asc order
        Arrays.sort(f, (a, b) -> a[0] - b[0]);
        for (int i = 0; i < f.length; i++) {
            if (f[i][1] == 0) {
                int[] temp = f[f.length - 1];
                f[f.length - 1] = f[i];
                f[i] = temp;
                f = Arrays.copyOf(f, f.length - 1);
                break;
            }
        }

        // Sort robots by x-position in asc order
        int[] robotArray = new int[robot.size()];
        for (int i = 0; i < robot.size(); i++) {
            robotArray[i] = robot.get(i);
        }
        Arrays.sort(robotArray);

        long totalDistance = 0;
        int factoryIndex = 0;
        for (int i = robotArray.length - 1; i >= 0; i--) {
            while (factoryIndex < f.length && f[factoryIndex][1] > 0) {
                if (robotArray[i] <= f[factoryIndex][0]) {
                    totalDistance += Math.abs(robotArray[i] - f[factoryIndex][0]);
                    robotArray[i] = f[factoryIndex][0];
                    f[factoryIndex][1]--;
                    break;
                }
                factoryIndex++;
            }
        }

        // add the remaining distance for each robot
        for (int i = 0; i < robotArray.length; i++) {
            totalDistance += Math.abs(robotArray[i] - f[0][0]);
        }

        return totalDistance;
    }
}

