public class Solution {
    public List<List<Integer>> getAnswers(TreeNode root, int[] queries) {
        List<List<Integer>> answer = new ArrayList<>();
        for (int query : queries) {
            List<Integer> queryAnswer = new ArrayList<>();
            queryAnswer.add(getMinLessEqual(root, query));
            queryAnswer.add getMaxGreaterEqual(root, query));
            answer.add(queryAnswer);
        }
        return answer;
    }

    private int getMinLessEqual(TreeNode root, int target) {
        TreeNode current = root;
        int min = Integer.MAX_VALUE;
        while (current != null) {
            if (target < current.val) {
                min = Math.min(min, current.val);
                current = current.left;
            } else {
                current = current.right;
            }
        }
        return min == Integer.MAX_VALUE ? -1 : min;
    }

    private int getMaxGreaterEqual(TreeNode root, int target) {
        TreeNode current = root;
        int max = Integer.MIN_VALUE;
        while (current != null) {
            if (target > current.val) {
                max = Math.max(max, current.val);
                current = current.right;
            } else {
                current = current.left;
            }
        }
        return max == Integer.MIN_VALUE ? -1 : max;
    }
}

