import java.util.PriorityQueue;
import java.util.Queue;

public class Solution {
    public long totalCost(int[] costs, int k, int candidates) {
        Queue<Integer> left = new PriorityQueue<>((a, b) -> a - b);
        Queue<Integer> right = new PriorityQueue<>((a, b) -> a - b);

        for (int i = 0; i < Math.min(candidates, costs.length); i++) {
            left.add(costs[i]);
        }

        for (int i = costs.length - 1; i >= costs.length - candidates; i--) {
            right.add(costs[i]);
        }

        long totalCost = 0;
        for (int i = 0; i < k; i++) {
            if (!left.isEmpty() && !right.isEmpty()) {
                int leftCost = left.peek();
                int rightCost = right.peek();

                if (leftCost <= rightCost) {
                    totalCost += left.poll();
                } else {
                    totalCost += right.poll();
                }
            } else if (!left.isEmpty()) {
                totalCost += left.poll();
            } else {
                totalCost += right.poll();
            }
        }

        return totalCost;
    }
}

