            PriorityQueue<Integer> queue = new PriorityQueue<>();

            // Perform a BFS traversal starting from the current node
            queue.add(node);
            while (!queue.isEmpty()) {
                int currentNode = queue.poll();
                if (!visited[currentNode]) {
                    visited[currentNode] = true;
                    currentStarSum += nodeValues[currentNode];
                    for (int neighbor : graph.get(currentNode)) {
                        if (!visited[neighbor]) {
                            queue.add(neighbor);
                        }
                    }
                }
            }

            // Update the maximum star sum
            maxStarSum = Math.max(maxStarSum, currentStarSum);

            // Check if the number of edges in the current star is less than or equal to k
            int edgeCount = 0;
            for (int neighbor : graph.get(node)) {
                if (visited[neighbor]) {
                    edgeCount++;
                }
            }
            while (edgeCount > maxNumberOfEdges) {
                // Remove the node with the smallest value from the star
                int minNode = -1;
                int minValue = Integer.MAX_VALUE;
                for (int neighbor : graph.get(node)) {
                    if (visited[neighbor] && nodeValues[neighbor] < minValue) {
                        minNode = neighbor;
                        minValue = nodeValues[neighbor];
                    }
                }
                visited[minNode] = false;
                edgeCount--;
            }

            // Update the maximum star sum
            maxStarSum = Math.max(maxStarSum, currentStarSum);
        }

        return maxStarSum;
    }
}

