public class Solution {
    public int minimumOperations(TreeNode root) {
        if (root == null) return 0;

        Queue<TreeNode> queue = new ArrayDeque<>();
        queue.offer(root);

        List<Integer> currentLevelValues = new ArrayList<>();
        int operations = 0;

        while (!queue.isEmpty()) {
            int levelSize = queue.size();
            for (int i = 0; i < levelSize; i++) {
                TreeNode node = queue.poll();
                currentLevelValues.add(node.val);

                if (node.left != null) queue.offer(node.left);
                if (node.right != null) queue.offer(node.right);
            }

            Arrays.sort(currentLevelValues.toArray(new Integer[0]));
            operations += binarySearch(currentLevelValues, 0, currentLevelValues.size() - 1);
            currentLevelValues.clear();
        }

        return operations;
    }

    private int binarySearch(List<Integer> list, int low, int high) {
        if (low >= high) return 0;

        int mid = low + (high - low) / 2;
        int left = low;
        while (left < mid && list.get(left) <= list.get(mid)) left++;
        int right = mid + 1;
        while (right <= high && list.get(right) >= list.get(mid)) right--;

        return Math.max(left, right) - low;
    }
}

