public class Solution {
    public int maxJump(int[] stones) {
        Arrays.sort(stones);
        int n = stones.length;
        int[] dp = new int[n];
        dp[0] = 1;
        for (int i = 1; i < n; i++) {
            int j = binarySearch(stones, 0, i - 1, stones[i]);
            if (j == -1) {
                dp[i] = 1;
            } else {
                dp[i] = Math.max(dp[j], 1);
            }
        }
        return dp[n - 1];
    }

    public int binarySearch(int[] stones, int left, int right, int target) {
        while (left <= right) {
            int mid = left + (right - left) / 2;
            if (stones[mid] == target) {
                return mid;
            } else if (stones[mid] < target) {
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }
        return -1;
    }
}

