public class Solution {
    public int maxPalindromes(String s, int k) {
        int n = s.length();
        int[] dp = new int[n + 1];
        Arrays.fill(dp, 0);

        for (int i = k; i <= n; i++) {
            for (int j = i; j >= k; j--) {
                if (isPalindrome(s.substring(j - k, i))) {
                    dp[i] = Math.max(dp[i], dp[j - k] + 1);
                }
            }
        }

        return dp[n];
    }

    private boolean isPalindrome(String s) {
        int left = 0;
        int right = s.length() - 1;

        while (left < right) {
            if (s.charAt(left) != s.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }

        return true;
    }
}

