public class Solution {
    public int beautifulPartitions(String s, int k, int l) {
        int MOD = 1000000007;
        boolean[] prime = new boolean[10];
        prime[2] = true; prime[3] = true; prime[5] = true; prime[7] = true;

        long res = 0;
        for (int i = 1; i <= s.length(); i++) {
            if (!prime[s.charAt(i - 1)]) break;
            int len = i;
            while (len + l <= s.length() && !prime[s.charAt(len)]) len++;
            res += dfs(s, k, l, len);
        }
        return (int) (res % MOD);
    }

    public long dfs(String s, int k, int l, int end) {
        if (end < l) return 0;
        if (k == 1) return 1;

        long res = 0;
        for (int i = l; i <= end; i++) {
            if (!isPrime(s.charAt(i - 1))) break;
            res += dfs(s, k - 1, i, end);
        }
        return res;
    }

    public boolean isPrime(int x) {
        if (x == 2 || x == 3 || x == 5 || x == 7) return true;
        if (x < 2) return false;
        for (int i = 2; i * i <= x; i++) {
            if (x % i == 0) return false;
        }
        return true;
    }
}

