        long sumOfChemistry = 0;
        int left = n / 2;
        for (int i : skill) {
            if (left > map.get(i)) {
                sumOfChemistry += (long) Math.pow(i, 2);
            } else {
                sumOfChemistry += (long) Math.pow(i, 2) * (n - left);
            }
            map.put(i, map.get(i) - 1);
            if (--left == 0) break;
        }

        return totalSkill / n + sumOfChemistry;
    }
}

