        List<int[]> list = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            list.add(new int[]{nums[i], cost[i]});
        }
        list.sort(Comparator.comparingInt(a -> a[1]));

        int totalCost = 0;
        int target = list.get(0)[0];
        for (int[] pair : list) {
            if (pair[0] > target) {
                totalCost += Math.abs(pair[0] - target) * pair[1];
                break;
