                while (!queue.isEmpty()) {
                    int node = queue.poll();
                    groupSize++;

                    for (int neighbor : graph.get(node)) {
                        if (!visited[neighbor]) {
                            queue.add(neighbor);
                            visited[neighbor] = true;
                        }
                    }
                }

                maxGroups = Math.max(maxGroups, groupSize);
            }
        }

        return maxGroups == 1 ? -1 : maxGroups;
    }
