            powers.add((int)Math.pow(2, Integer.toBinaryString(n).length() - 1));
            n -= (int)Math.pow(2, Integer.toBinaryString(n).length() - 1);
        }

        int[] answers = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int left = queries[i][0], right = queries[i][1];
            long product = 1;
            for (int j = left; j <= right; j++) {
                product *= powers.get(j);
            }
            answers[i] = (int)(product % (1000000007));
        }

        return answers;
    }
}

