public class Solution {
    public int boxDelivering(int[][] boxes, int portsCount, int maxBoxes, int maxWeight) {
        Arrays.sort(boxes, (a, b) -> a[0] - b[0]);
        int trips = 0;
        int currPort = 1;
        int currBoxes = 0;
        int currWeight = 0;
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[0] - b[0]);

        for (int[] box : boxes) {
            while (!pq.isEmpty() && pq.peek()[0] < box[0]) {
                int[] topBox = pq.poll();
                currPort = topBox[0];
                currBoxes -= 1;
                currWeight -= topBox[1];
            }
            if (currBoxes >= maxBoxes || currWeight + box[1] > maxWeight) {
                trips++;
                currPort = 1;
                currBoxes = 0;
                currWeight = 0;
            }
            pq.offer(box);
            currPort = box[0];
            currBoxes += 1;
            currWeight += box[1];
        }

        while (!pq.isEmpty()) {
            int[] topBox = pq.poll();
            currPort = topBox[0];
            currBoxes -= 1;
            currWeight -= topBox[1];
            trips++;
        }
        return trips;
    }
}

