public class Solution {
    public int[][] matrixRankTransform(int[][] matrix) {
        int m = matrix.length;
        int n = matrix[0].length;
        List<int[]> rows = new ArrayList<>();
        List<int[]> cols = new ArrayList<>();

        for (int i = 0; i < m; i++) {
            rows.add(new int[]{i, -1});
        }
        for (int j = 0; j < n; j++) {
            cols.add(new int[]{j, -1});
        }

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (matrix[i][j] == -1) continue;
                for (int k = 0; k < m; k++) {
                    if (k != i && matrix[k][j] == matrix[i][j]) {
                        rows.set(k, new int[]{k, rows.get(i)[1]});
                        break;
                    }
                }
                for (int k = 0; k < n; k++) {
                    if (k != j && matrix[i][k] == matrix[i][j]) {
                        cols.set(k, new int[]{k, cols.get(j)[1]});
                        break;
                    }
                }
            }
        }

        Arrays.sort(rows.toArray());
        Arrays.sort(cols.toArray());

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (matrix[i][j] == -1) continue;
                int rank = 0;
                for (int k = 0; k < rows.size(); k++) {
                    if (rows.get(k)[0] == i && rows.get(k)[1] > rank) rank = rows.get(k)[1];
                }
                for (int k = 0; k < cols.size(); k++) {
                    if (cols.get(k)[0] == j && cols.get(k)[1] > rank) rank = cols.get(k)[1];
                }
                matrix[i][j] = rank;
            }
        }

        return matrix;
    }
}

