public class Solution {
    public List<Boolean> areConnected(int n, int threshold, int[][] queries) {
        UnionFind uf = new UnionFind(n);
        for (int i = 1; i <= n; i++) {
            for (int j = i + 1; j <= n; j++) {
                if (i % j == 0 || j % i == 0) {
                    uf.union(i, j);
                }
            }
        }
        List<Boolean> result = new ArrayList<>();
        for (int[] query : queries) {
