class UnionFind {
    private int[] parent;

    public UnionFind(int n) {
        parent = new int[n + 1];
        for (int i = 1; i <= n; i++) {
            parent[i] = i;
        }
    }

    public void union(int a, int b) {
        if (parent[a] != parent[b]) {
            parent[parent[a]] = parent[b];
        }
    }

    public boolean isConnected(int a, int b) {
        return parent[a] == parent[b];
    }
}

