public class Solution {
    public int[] countSubgraphsForEachDiameter(int n, int[][] edges) {
        List<Integer>[] tree = new List[n];
        for (int i = 0; i < n; i++) {
            tree[i] = new ArrayList<>();
        }
        for (int[] edge : edges) {
            tree[edge[0]].add(edge[1]);
            tree[edge[1]].add(edge[0]);
        }

        int[] res = new int[n - 1];
        for (int d = 1; d < n; d++) {
            int count = 0;
            for (int i = 0; i < n; i++) {
                boolean found = false;
                for (int j : tree[i]) {
                    if (dfs(tree, i, j, d)) {
                        found = true;
                        break;
                    }
                }
                if (!found) {
                    count++;
                }
            }
            res[d - 1] = count;
        }
        return res;
    }

    private boolean dfs(List<Integer>[] tree, int start, int end, int d) {
        List<Integer> path = new ArrayList<>();
        while (start != end) {
            if (!tree[start].contains(end)) {
                return false;
            }
            path.add(start);
            for (int next : tree[start]) {
                if (next == end) {
                    start = next;
                    break;
                } else if (!path.contains(next)) {
                    start = next;
                    break;
                }
            }
        }
        int len = path.size();
        return len % 2 != 0 || len / 2 + 1 > d;
    }
}

