public class Solution {
    public int[] bestCoordinate(int[][] towers, int radius) {
        Arrays.sort(towers, (a, b) -> a[0] - b[0]);

        for (int i = 0; i < towers.length; i++) {
            if (towers[i][1] > 0) break;
        }

        int maxQuality = 0;
        int[] bestCoordinate = new int[]{0, 0};

        for (int x = -10000; x <= 10000; x++) {
            for (int y = -10000; y <= 10000; y++) {
                if ((x * x + y * y) > radius * radius) continue;

                int quality = 0;
                for (int[] tower : towers) {
                    double distance = Math.sqrt((x - tower[0]) * (x - tower[0]) + (y - tower[1]) * (y - tower[1]));
                    if (distance > radius) continue;

                    quality += (int) ((double) tower[2] / (1 + distance));
                }

                if (quality > maxQuality) {
                    maxQuality = quality;
                    bestCoordinate = new int[]{x, y};
                } else if (quality == maxQuality) {
                    bestCoordinate[0] = Math.min(bestCoordinate[0], x);
                    bestCoordinate[1] = Math.min(bestCoordinate[1], y);
                }
            }
        }

        return bestCoordinate;
    }
}

