import java.util.PriorityQueue;
import java.util.Queue;

public class Solution {
    public int minimumEffort(int[][] heights) {
        int rows = heights.length;
        int cols = heights[0].length;
        int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
        Queue<int[]> queue = new PriorityQueue<>((a, b) -> a[2] - b[2]);
        boolean[][] visited = new boolean[rows][cols];
        int minEffort = Integer.MAX_VALUE;

        queue.offer(new int[]{0, 0, 0});
        visited[0][0] = true;

        while (!queue.isEmpty()) {
            int[] cell = queue.poll();
            int row = cell[0], col = cell[1], effort = cell[2];

            if (row == rows - 1 && col == cols - 1) {
                minEffort = Math.min(minEffort, effort);
                break;
            }

            for (int[] direction : directions) {
                int newRow = row + direction[0], newCol = col + direction[1];
                if (newRow >= 0 && newRow < rows && newCol >= 0 && newCol < cols && !visited[newRow][newCol]) {
                    visited[newRow][newCol] = true;
                    queue.offer(new int[]{newRow, newCol, Math.max(effort, Math.abs(heights[newRow][newCol] - heights[row][col]))});
                }
            }
        }

        return minEffort;
    }
}

