import java.math.BigInteger;
import java.util.Arrays;

public class Solution {
    public int numberOfSets(int n, int k) {
        BigInteger MOD = new BigInteger("1000000007");
        long[][] dp = new long[k + 1][n + 1];
        for (int i = 0; i <= k; i++) {
            Arrays.fill(dp[i], -1);
        }
        return (int) solve(n, k, dp).mod(MOD).longValue();
    }

    private BigInteger solve(int n, int k, long[][] dp) {
        if (n < 2) {
            return new BigInteger("1");
        }
        if (k == 0) {
            return new BigInteger("1");
        }
        if (dp[k][n] != -1) {
            return new BigInteger(String.valueOf(dp[k][n]));
        }
        long res = 0;
        for (int i = 2; i <= n; i++) {
            res += solve(i - 1, k - 1, dp).longValue();
        }
        dp[k][n] = res;
        return new BigInteger(String.valueOf(res)).mod(new BigInteger("1000000007"));
    }
}

