public class Solution {
    public int stoneGameVII(int[] stones) {
        int n = stones.length;
        int[][] dp = new int[n][n];

        for (int i = 0; i < n; i++) {
            dp[i][i] = stones[i];
        }

        for (int len = 2; len <= n; len++) {
            for (int i = 0; i <= n - len; i++) {
                int j = i + len - 1;

                if (len % 2 == 1) {
                    dp[i][j] = Math.max(stones[i] - dp[i+1][j], stones[j] - dp[i][j-1]);
                } else {
                    dp[i][j] = Math.min(dp[i+1][j], dp[i][j-1]) + stones[i];
                }
            }
        }

        return dp[0][n-1];
    }
}

