import java.util.Arrays;

public class Solution {
    public int highestScore(int[] scores, int[] ages) {
        int n = scores.length;
        Integer[][] dp = new Integer[n][n];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dp[i], null);
        }
        return dfs(scores, ages, 0, 0, dp);
    }

    private int dfs(int[] scores, int[] ages, int i, int j, Integer[][] dp) {
        if (i == scores.length) {
            return 0;
        }
        if (dp[i][j] != null) {
            return dp[i][j];
        }
        int res = 0;
        while (j < scores.length && ages[j] <= ages[i]) {
            j++;
        }
        for (; j < scores.length; j++) {
            boolean conflict = false;
            for (int k = i; k < j; k++) {
                if (ages[k] < ages[j] && scores[k] > scores[j]) {
                    conflict = true;
                    break;
                }
            }
            if (!conflict) {
                res += scores[j];
                int temp = dfs(scores, ages, j + 1, j + 1, dp);
                res += temp;
                dp[i][j] = res;
                return res;
            }
        }
        dp[i][j] = 0;
        return 0;
    }
}

