        for (int i = 0; i < chars[index]; i++) {
            if (!map.containsKey((char)chars[index])) {
                res = Integer.MAX_VALUE;
                return;
            }
        }
        for (int sticker : map.get((char)chars[index])) {
            if (used[sticker]) continue;
            used[sticker] = true;
            dfs(map, chars, index + 1, path + (char)chars[index], used, res);
            used[sticker] = false;
        }
    }
