import java.util.*;

public class Solution {
    public int cutOffTree(List<List<Integer>> forest) {
        int m = forest.size();
        int n = forest.get(0).size();
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[2] - b[2]);

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (forest.get(i).get(j) > 1) {
                    pq.offer(new int[]{i, j, forest.get(i).get(j)});
                }
            }
        }

        int res = 0;
        while (!pq.isEmpty()) {
            int[] tree = pq.poll();
            int x = tree[0], y = tree[1];

            int steps = bfs(forest, x, y);
            if (steps == -1) {
                return -1;
            }
            res += steps;
        }

        return res;
    }

    private int bfs(List<List<Integer>> forest, int x, int y) {
        int m = forest.size();
        int n = forest.get(0).size();
        boolean[][] visited = new boolean[m][n];
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{x, y});
        visited[x][y] = true;

        int res = 0;
        while (!queue.isEmpty()) {
            int[] pos = queue.poll();
            x = pos[0]; y = pos[1];

            if (forest.get(x).get(y) > 1) {
                return -1;
            }

            for (int dx : {-1, 1}) {
                int nx = x + dx;
                if (nx < 0 || nx >= m) continue;

                for (int dy : {-1, 1}) {
                    int ny = y + dy;
                    if (ny < 0 || ny >= n || visited[nx][ny]) continue;

                    queue.offer(new int[]{nx, ny});
                    visited[nx][ny] = true;
                }
            }

            res++;
        }

        return res;
    }
}

