import java.util.ArrayList;
import java.util.List;

public class Solution {
    public int[] maxSumOfThreeSubarrays(int[] nums, int k) {
        List<Integer> res = new ArrayList<>();
        int n = nums.length;
        int[] left = new int[n];
        int[] right = new int[n];

        // calculate the sum of subarray from 0 to i
        int curr_sum = 0;
        for (int i = 0; i < k; i++) {
            curr_sum += nums[i];
        }
        left[0] = curr_sum;

        for (int i = k; i < n; i++) {
            curr_sum = curr_sum - nums[i - k] + nums[i];
            left[i] = Math.max(left[i - 1], curr_sum);
        }

        // calculate the sum of subarray from i to n-1
        curr_sum = 0;
        for (int i = n - 1; i >= n - k; i--) {
            curr_sum += nums[i];
        }
        right[n - 1] = curr_sum;

        for (int i = n - k - 1; i >= 0; i--) {
            curr_sum = curr_sum - nums[i + k] + nums[i];
            right[i] = Math.max(right[i + 1], curr_sum);
        }

        int max_sum = 0;
        for (int i = k; i <= n - 2 * k; i++) {
            if (left[i] + right[i + k] > max_sum) {
                max_sum = left[i] + right[i + k];
                res.clear();
                res.add(i);
                res.add(i + k);
                res.add(i + 2 * k);
            }
        }

        return new int[]{res.get(0), res.get(1), res.get(2)};
    }
}

