import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int numDecodings(String s) {
        Map<Character, Integer> map = new HashMap<>();
        for (int i = 1; i <= 26; i++) {
            map.put((char)(65 + i - 1), i);
        }

        int[] dp = new int[s.length() + 1];
        dp[0] = 1;
        for (int i = 1; i <= s.length(); i++) {
            if (s.charAt(i - 1) != '*') {
                int num = map.getOrDefault(s.charAt(i - 1), 0);
                if (i > 1 && s.substring(i - 2, i).equals("1*") || s.substring(i - 2, i).equals("2*")) {
                    dp[i] += dp[i - 2];
                }
                if (num >= 1 && (i < s.length() && s.charAt(i) == '*' || num <= 26)) {
                    dp[i] += dp[i - 1];
                }
            } else {
                if (i > 1 && s.substring(i - 2, i).equals("1*")) {
                    dp[i] = dp[i - 2];
                } else if (i > 1 && s.substring(i - 2, i).equals("2*")) {
                    dp[i] = dp[i - 2];
                } else {
                    dp[i] += dp[i - 1];
                }
            }
        }

        return dp[s.length()] % (1000000007);
    }
}

