import java.util.Arrays;

public class Solution {
    public int findKthNumber(int m, int n, int k) {
        int start = 1;
        int end = m * n;

        while (true) {
            int count = min(start + n - 1, end) - start + 1;

            if (k <= count) {
                end = start + n - 1;
                k -= 1;
            } else {
                start += n;
                k -= count;
            }

            if (k == 0) {
                return start;
            }
        }
    }

    private int min(int a, int b) {
        return a < b ? a : b;
    }
}

