import java.util.TreeSet;

public class Solution {
    public List<Integer> fallingSquares(int[][] positions) {
        TreeSet<Integer> xCoord = new TreeSet<>();
        for (int[] pos : positions) {
            int left = pos[0];
            int sideLength = pos[1];
            while (xCoord.higherKey(left)) {
                left = xCoord.high();
                xCoord.remove(xCoord.high());
            }
            xCoord.add(left + sideLength);
        }

        List<Integer> ans = new ArrayList<>();
        int maxHeight = 0;
        for (int i : positions[0]) {
            ans.add(0);
        }
        for (int[] pos : positions) {
            int left = pos[0];
            int sideLength = pos[1];
            while (xCoord.higherKey(left)) {
                left = xCoord.high();
                xCoord.remove(xCoord.high());
            }
            int maxHeightAtLeft = 0;
            for (Integer coord : xCoord.subSet(left, true, left + sideLength, false)) {
                maxHeightAtLeft = Math.max(maxHeightAtLeft, ans.get(coord) + 1);
            }
            ans.add(maxHeightAtLeft);
            maxheight = Math.max(maxHeight, maxHeightAtLeft);
        }

        return ans;
    }
}

