import java.util.Arrays;

public class Solution {
    public int kInversePairs(int n, int k) {
        long MOD = 1000000007;
        int[] dp = new int[n + 1];
        Arrays.fill(dp, 0);
        for (int i = 1; i <= n; i++) {
            dp[i] = 1;
        }
        for (int i = 2; i <= n; i++) {
            for (int j = 1; j < i; j++) {
                if (k >= i - j) {
                    k -= i - j;
                    dp[i] += dp[j];
                    if (dp[i] >= MOD) {
                        dp[i] -= MOD;
                    }
                } else {
                    break;
                }
            }
        }
        return (int) ((dp[n] + k) % MOD);
    }
}

