public class Solution {
    public int findLongestChain(int[][] pairs) {
        Arrays.sort(pairs, new Comparator<int[]>() {
            @Override
            public int compare(int[] pair1, int[] pair2) {
                return Integer.compare(pair1[1], pair2[0]);
            }
        });

        int maxLen = 0;
        int prevEnd = Integer.MIN_VALUE;

        for (int[] pair : pairs) {
            if (pair[0] > prevEnd) {
                maxLen++;
                prevEnd = pair[1];
            }
        }

        return maxLen;
    }
}

