import java.util.HashMap;
import java.util.Map;

public class Solution {
    public String solveEquation(String equation) {
        int left = 0, right = 0;
        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0; i < equation.length(); i++) {
            if (equation.charAt(i) == '=') {
                left = 0;
                right = 0;
                for (int j = i + 1; j < equation.length(); j++) {
                    if (Character.isDigit(equation.charAt(j))) {
                        right = right * 10 + (equation.charAt(j) - '0');
                    } else if (equation.charAt(j) == '+') {
                        right++;
                    } else if (equation.charAt(j) == '-') {
                        right--;
                    }
                }
            } else if (Character.isDigit(equation.charAt(i))) {
                left = left * 10 + (equation.charAt(i) - '0');
            } else if (equation.charAt(i) == '+') {
                left++;
            } else if (equation.charAt(i) == '-') {
                left--;
            }
        }

        int sumLeft = 0, sumRight = 0;
        for (Map.Entry<Integer, Integer> entry : map.entrySet()) {
            sumLeft += entry.getKey() * entry.getValue();
            sumRight += entry.getValue();
        }

        if (sumLeft == 0) {
            return right == 0 ? "Infinite solutions" : "No solution";
        } else {
            int x = sumRight / sumLeft;
            return x + "=" + Math.abs(sumRight % sumLeft);
        }
    }
}

