import java.util.Arrays;

public class Solution {
    public double knightProbability(int n, int k, int row, int column) {
        final int[][] directions = {{-2, -1}, {-2, 1}, {-1, -2}, {-1, 2}, {1, -2}, {1, 2}, {2, -1}, {2, 1}};
        double[] dp = new double[n * n];
        Arrays.fill(dp, 1.0 / 8);
        for (int i = k; i >= 0; i--) {
            if (row < 0 || row >= n || column < 0 || column >= n) {
                break;
            }
            dp[(row * n) + column] *= 1.0 / 8;
            for (final int[] direction : directions) {
                final int newRow = row + direction[0];
                final int newColumn = column + direction[1];
                if (newRow >= 0 && newRow < n && newColumn >= 0 && newColumn < n) {
                    dp[(row * n) + column] *= 1.0 - 1.0 / 8;
                }
            }
        }
        return dp[(row * n) + column];
    }
}

