public class Solution {
    public int findSecondMinimumValue(TreeNode root) {
        int result = -1;
        int minVal = root.val;

        dfs(root, minVal, 0);

        return result;
    }

    private void dfs(TreeNode node, int minVal, int level) {
        if (node == null) {
            return;
        }

        if (node.val > minVal && node.val < Integer.MAX_VALUE) {
            if (level == 0) {
                result = node.val;
            } else {
                if (result == -1 || node.val > result) {
                    result = node.val;
                }
            }
        }

        dfs(node.left, minVal, level + 1);
        dfs(node.right, minVal, level + 1);
    }
}

