import java.util.ArrayList;
import java.util.List;

public class Solution {
    public int calPoints(String[] ops) {
        List<Integer> scores = new ArrayList<>();
        int totalScore = 0;

        for (String op : ops) {
            if (op.equals("C")) {
                if (scores.size() > 1) {
                    scores.remove(scores.size() - 1);
                } else {
                    scores.clear();
                }
            } else if (op.equals("D")) {
                int lastScore = scores.get(scores.size() - 1);
                scores.add(lastScore * 2);
                totalScore += lastScore;
            } else if (op.equals("+")) {
                int lastTwoScores = scores.get(scores.size() - 1) + scores.get(scores.size() - 2);
                scores.add(lastTwoScores);
                totalScore += lastTwoScores;
            } else {
                int score = Integer.parseInt(op);
                scores.add(score);
                totalScore += score;
            }
        }

        for (int score : scores) {
            totalScore += score;
        }

        return totalScore;
    }
}

