                for (; dIndex < n; dIndex++) {
                    if (dire[dIndex] == 'D') {
                        System.arraycopy(dire, dIndex, dire, dIndex + 1, n - dIndex - 1);
                        dire[dIndex] = 'R';
                        break;
                    }
                }
            }

            if (dIndex >= n) break;
            if (dire[dIndex] == 'D') {
                dIndex++;
            } else {
                for (; rIndex < n; rIndex++) {
                    if (radiant[rIndex] == 'R') {
                        System.arraycopy(radiant, rIndex, radiant, rIndex + 1, n - rIndex - 1);
                        radiant[rIndex] = 'D';
                        break;
                    }
                }
            }
        }

        int rCount = 0, dCount = 0;
        for (int i = 0; i < n; i++) {
            if (radiant[i] == 'R') rCount++;
            else dCount++;
        }

        return rCount > dCount ? "Radiant" : "Dire";
    }
}

