public class Solution {
    public int findShortestWay(List<List<Integer>> lists) {
        int n = lists.size();
        int[] minIndex = new int[n];
        for (int i = 0; i < n; i++) {
            minIndex[i] = 0;
            for (int j = 1; j <= Math.pow(26, lists.get(i).size()); j++) {
                if (!lists.get(i).contains(j)) {
                    minIndex[i]++;
                } else {
                    break;
                }
            }
        }

        int res = Integer.MAX_VALUE;
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[0] - b[0]);
        for (int i = 0; i < n; i++) {
            pq.offer(new int[]{lists.get(i).get(0), i});
        }

        while (!pq.isEmpty()) {
            Queue<int[]> queue = new LinkedList<>();
            int[] cur = pq.poll();
            res = Math.min(res, cur[0]);
            for (int i = 1; i < n; i++) {
                if (cur[1] == minIndex[i]) {
                    queue.offer(new int[]{lists.get(i).get(0), i});
                }
            }

            while (!queue.isEmpty()) {
                cur = queue.poll();
                res = Math.min(res, cur[0]);
                for (int i = 1; i < n; i++) {
                    if (cur[1] == minIndex[i]) {
                        queue.offer(new int[]{lists.get(i).get(0), i});
                    }
                }
            }
        }

        return res;
    }
