import java.util.ArrayList;
import java.util.List;

public class Solution {
    public double shoppingOffers(List<Integer> price, List<List<Integer>> special, List<Integer> needs) {
        int n = needs.size();
        boolean[] visited = new boolean[1 << n];
        double minPrice = 0;

        for (List<Integer> offer : special) {
            int mask = 0;
            int offerPrice = offer.get(n);
            for (int i = 0; i < n; i++) {
                if (offer.get(i) <= needs.get(i)) {
                    mask |= 1 << i;
                    needs.set(i, needs.get(i) - offer.get(i));
                }
            }

            if (!visited[mask]) {
                visited[mask] = true;
                double newPrice = minPrice + offerPrice;
                for (int i = 0; i < n; i++) {
                    if ((mask & (1 << i)) != 0) {
                        newPrice += price.get(i);
                    }
                }

                if (newPrice > minPrice) {
                    minPrice = newPrice;
                } else {
                    double temp = shoppingOffers(price, special, needs);
                    if (temp < minPrice) {
                        minPrice = temp;
                    }
                }
            }
        }

        for (int i = 0; i < n; i++) {
            minPrice += price.get(i) * needs.get(i);
        }

        return minPrice;
    }
}

