public class Solution {
    public boolean canPartitionKSubsets(int[] nums, int k) {
        Arrays.sort(nums);
        if (nums[nums.length - 1] > (int) Math.pow(2, k - 1)) return false;

        for (int i = nums.length - 1; i >= 0; i--) {
            if (!canPartitionKSubsetsHelper(nums, k, i, 0)) return false;
        }

        return true;
    }

    public boolean canPartitionKSubsetsHelper(int[] nums, int k, int pos, int mask) {
        if (pos == nums.length) return true;

        for (int i = k - 1; i >= 0; i--) {
            int start = Math.max(0, Integer.bitCount(mask ^ ((1 << i) - 1)));
            while (start < nums.length && (mask & (1 << start)) == 0) {
                if (nums[start] > (int) Math.pow(2, k - 1 - i)) return false;
                if (!canPartitionKSubsetsHelper(nums, k, start + 1, mask | (1 << start))) return false;
                break;
            }
        }

        return true;
    }
}

