                        curNode.left = newNodeLeft;

                        TreeNode newNodeRight = new TreeNode(val);
                        newNodeRight.right = curNode.right;
                        curNode.right = newNodeRight;
                    } else {
                        queue.offer(curNode.left);
                        queue.offer(curNode.right);
                    }
                }
            }

            depth--;
        }

        return root;
    }
