public class Solution {
    public List<List<String>> printTree(TreeNode root) {
        int height = getHeight(root);
        int m = height + 1;
        int n = (int)Math.pow(2, height + 1) - 1;

        List<List<String>> res = new ArrayList<>();
        for(int i = 0; i < m; i++) {
            List<String> row = new ArrayList<>();
            for(int j = 0; j < n; j++) {
                row.add("");
            }
            res.add(row);
        }

        printTreeHelper(root, res, height, (n - 1) / 2);

        return res;
    }

    private int getHeight(TreeNode root) {
        if(root == null) {
            return 0;
        } else {
            return Math.max(getHeight(root.left), getHeight(root.right)) + 1;
        }
    }

    private void printTreeHelper(TreeNode node, List<List<String>> res, int height, int pos) {
        if(node == null) {
            return;
        }

        int r = height - 1;
        for(int i = 0; i < height; i++) {
            res.get(r).set(pos, String.valueOf(node.val));
            if(i < height / 2) {
                pos -= (int)Math.pow(2, height - 1 - i);
            } else {
                pos += (int)Math.pow(2, height - 1 - i);
            }
        }

        printTreeHelper(node.left, res, height - 1, pos - (int)Math.pow(2, height - 1));
        printTreeHelper(node.right, res, height - 1, pos + (int)Math.pow(2, height - 1));
    }
}

