            if (i == k) {
                maxProfit = Math.max(maxProfit, dp[i][0] - prices[k-1]);
            } else {
                maxProfit = Math.max(maxProfit, dp[i][0] - prices[i-k]);
            }
        }

        return maxProfit;
    }
}

