                    dp[i][j] = Math.max(1, 1 - dungeon[i][j]);
                } else if (i == m - 1) {
                    dp[i][j] = Math.max(1, 1 - dungeon[i][j] + dp[i][j + 1]);
                } else if (j == n - 1) {
                    dp[i][j] = Math.max(1, 1 - dungeon[i][j] + dp[i + 1][j]);
                } else {
                    int minHP = Math.min(dp[i + 1][j], dp[i][j + 1]) - dungeon[i][j];
                    if (minHP < 0) minHP = 1;
                    dp[i][j] = minHP;
                }
            }
        }

        return dp[0][0];
    }
}

