public class Solution {
    public int maxPathSum(TreeNode root) {
        int maxSum = Integer.MIN_VALUE;
        maxGain(root, null, maxSum);
        return maxSum;
    }

    private int maxGain(TreeNode node, TreeNode parent, int maxSum) {
        if (node == null) {
            return 0;
        }

        int leftGain = 0;
        int rightGain = 0;

        if (parent != null) {
            if (node.val >= parent.val) {
                leftGain = node.val;
            } else {
                leftGain = parent.val - node.val;
            }

            if (node.right != null) {
                rightGain = maxGain(node.right, node, 0);
            }
            if (node.left != null) {
                int leftGainTemp = maxGain(node.left, node, 0);
                rightGain = Math.max(rightGain, leftGainTemp);
            }
        } else {
            leftGain = node.val;
            if (node.right != null) {
                rightGain = maxGain(node.right, node, 0);
            }
            if (node.left != null) {
                int leftGainTemp = maxGain(node.left, node, 0);
                rightGain = Math.max(rightGain, leftGainTemp);
            }
        }

        maxSum = Math.max(maxSum, leftGain + rightGain);

        return leftGain + rightGain;
    }
}

