import java.util.Arrays;

public class Solution {
    public int maximumGap(int[] nums) {
        if (nums.length < 2) return 0;

        int min = Arrays.stream(nums).min().getAsInt();
        int max = Arrays.stream(nums).max().getAsInt();

        int bucketSize = Math.max(1, (max - min) / (nums.length - 1));
        int[] minBucket = new int[nums.length];
        int[] maxBucket = new int[nums.length];

        for (int num : nums) {
            int index = (num - min) / bucketSize;
            if (minBucket[index] == 0) {
                minBucket[index] = num;
                maxBucket[index] = num;
            } else {
                minBucket[index] = Math.min(minBucket[index], num);
                maxBucket[index] = Math.max(maxBucket[index], num);
            }
        }

        int maxGap = 0;
        int prevMax = maxBucket[0];
        for (int i = 1; i < nums.length; i++) {
            if (minBucket[i] != 0) {
                maxGap = Math.max(maxGap, minBucket[i] - prevMax);
                prevMax = maxBucket[i];
            }
        }

        return maxGap;
    }
}

