import com_github_leetcode.TreeNode;
import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<List<Integer>> pathSum(TreeNode root, int targetSum) {
        List<List<Integer>> result = new ArrayList<>();
        if (root == null) return result;

        dfs(root, targetSum, 0, new ArrayList<>(), result);

        return result;
    }

    private void dfs(TreeNode node, int targetSum, int sumSoFar, List<Integer> path, List<List<Integer>> result) {
        if (node == null) return;

        path.add(node.val);
        sumSoFar += node.val;

        if (node.left == null && node.right == null) {
            if (sumSoFar == targetSum) {
                result.add(new ArrayList<>(path));
            }
        } else {
            dfs(node.left, targetSum, sumSoFar, path, result);
            dfs(node.right, targetSum, sumSoFar, path, result);
        }

        if (!node.leftVisited && node.left != null) {
            dfs(node.left, targetSum, sumSoFar + node.val, new ArrayList<>(path), result);
            node.leftVisited = true;
        }

        if (!node.rightVisited && node.right != null) {
            dfs(node.right, targetSum, sumSoFar + node.val, new ArrayList<>(path), result);
            node.rightVisited = true;
        }

        path.remove(path.size() - 1);
    }
}

