import java.util.Arrays;

public class Solution {
    public void solve(char[][] board) {
        if (board.length == 0) return;

        int m = board.length, n = board[0].length;

        // Edge case, empty grid
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if ((i == 0 || board[i][j] == 'X') && (j == 0 || board[i][j] == 'X') && (i == m - 1 || board[i][j] == 'X') && (j == n - 1 || board[i][j] == 'X')) {
                    dfs(board, i, j);
                }
            }
        }

        // Traverse first and last rows (boundaries)
        for (int j = 0; j < n; j++) {
            if ((board[0][j] == 'O') || (board[m - 1][j] == 'O')) {
                board[0][j] = '#';
                board[m - 1][j] = '#';
            }
        }

        // Traverse first and last Column (boundaries)
        for (int i = 0; i < m; i++) {
            if ((board[i][0] == 'O') || (board[i][n - 1] == 'O')) {
                board[i][0] = '#';
                board[i][n - 1] = '#';
            }
        }

        // Traverse through entire matrix
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (board[i][j] == 'O') {
                    board[i][j] = 'X';
                } else if (board[i][j] == '#') {
                    board[i][j] = 'O';
                }
            }
        }
    }

    private void dfs(char[][] board, int i, int j) {
        if (i < 0 || i >= board.length || j < 0 || j >= board[0].length || board[i][j] != 'O') return;

        board[i][j] = '#';

        for (int x : Arrays.asList(-1, 1)) {
            dfs(board, i + x, j);
        }
        for (int y : Arrays.asList(-1, 1)) {
            dfs(board, i, j + y);
        }
    }
}

