public class Solution {
    public TreeNode constructFromPreIn(int[] preorder, int[] inorder) {
        if (preorder == null || inorder == null || preorder.length != inorder.length) {
            return null;
        }

        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0; i < inorder.length; i++) {
            map.put(inorder[i], i);
        }

        return constructFromPreIn(preorder, inorder, 0, preorder.length - 1, 0, inorder.length - 1, map);
    }

    private TreeNode constructFromPreIn(int[] preorder, int[] inorder, int preStart, int preEnd, int inStart, int inEnd, Map<Integer, Integer> map) {
        if (preStart > preEnd || inStart > inEnd) {
            return null;
        }

        int rootVal = preorder[preStart];
        TreeNode root = new TreeNode(rootVal);

        int inRootIndex = map.get(rootVal);

        root.left = constructFromPreIn(preorder, inorder, preStart + 1, preStart + inRootIndex - inStart + 1, inStart, inRootIndex - 1, map);
        root.right = constructFromPreIn(preorder, inorder, preStart + inRootIndex - inStart + 2, preEnd, inRootIndex + 1, inEnd, map);

        return root;
    }
}

