public class Solution {
    public int minCut(String s) {
        int n = s.length();
        boolean[][] palindrome = new boolean[n][n];
        for (int i = 0; i < n; i++) {
            palindrome[i][i] = true;
        }
        for (int length = 2; length <= n; length++) {
            for (int i = 0; i < n - length + 1; i++) {
                int j = i + length - 1;
                if (s.charAt(i) == s.charAt(j) && length == 2 || palindrome[i + 1][j - 1]) {
                    palindrome[i][j] = true;
                }
            }
        }
        int[] cuts = new int[n];
        for (int i = 0; i < n; i++) {
            if (!palindrome[0][i]) {
                cuts[i] = i > 0 ? cuts[i - 1] + 1 : i;
            } else {
                cuts[i] = i > 0 ? cuts[i - 1] : 0;
            }
        }
        return cuts[n - 1];
    }
}

