        // find the middle of the linked list
        ListNode slow = head, fast = head;
        while (fast.next != null && fast.next.next != null) {
            slow = slow.next;
            fast = fast.next.next;
        }

        // reverse the second half of the linked list
        ListNode prev = null, curr = slow.next;
