import java.util.*;

public class Solution {
    public List<List<String>> findLadders(String beginWord, String endWord, List<String> wordList) {
        Map<String, List<String>> graph = new HashMap<>();
        Set<String> wordSet = new HashSet<>(wordList);
        wordSet.add(beginWord);

        Queue<List<String>> queue = new LinkedList<>();
        List<List<String>> ans = new ArrayList<>();

        if (!wordSet.contains(endWord)) return ans;

        for (String word : wordList) {
            for (int i = 0; i < word.length(); i++) {
                char[] chars = word.toCharArray();
                for (char c = 'a'; c <= 'z'; c++) {
                    chars[i] = c;
                    String newWord = new String(chars);
                    if (!wordSet.contains(newWord)) continue;
                    graph.computeIfAbsent(word, k -> new ArrayList<>()).add(newWord);
                    graph.computeIfAbsent(newWord, k -> new ArrayList<>()).add(word);
                }
            }
        }

        List<String> path = new ArrayList<>();
        boolean found = false;

        for (String word : wordSet) {
            if (word.equals(endWord)) continue;
            path.add(word);
            queue.offer(path);

            while (!queue.isEmpty()) {
                path = queue.poll();
                if (path.size() > 1 && path.get(0).equals(endWord)) {
                    found = true;
                    break;
                }
                for (String neighbor : graph.getOrDefault(path.get(path.size() - 1), new ArrayList<>())) {
                    List<String> newPath = new ArrayList<>(path);
                    newPath.add(neighbor);
                    queue.offer(newPath);
                }
            }

            if (found) break;

            path.remove(path.size() - 1);
        }

        if (!found) return ans;

        while (!queue.isEmpty()) {
            path = queue.poll();
            List<String> reversedPath = new ArrayList<>(path);
            Collections.reverse(reversedPath);
            ans.add(reversedPath);
        }

        return ans;
    }
}

