public class Solution {
    public int movesToMakeZigzag(int[] nums) {
        int n = nums.length;
        int res1 = 0, res2 = 0;

        for (int i = 0; i < n; i++) {
            int left = i > 0 ? nums[i - 1] : Integer.MIN_VALUE;
            int right = i < n - 1 ? nums[i + 1] : Integer.MIN_VALUE;

            if ((i & 1) == 0) { // even index
                res1 += Math.max(0, nums[i] - left);
                res2 += Math.max(0, right - nums[i]);
            } else { // odd index
                res1 += Math.max(0, right - nums[i]);
                res2 += Math.max(0, nums[i] - left);
            }
        }

        return Math.min(res1, res2);
    }
}

