            if (root.val < x) {
                left = Math.max(left, getDepth(root.left, x));
                root = root.right;
            } else {
                right = Math.min(right, getDepth(root.right, x));
                root = root.left;
            }
        }

        return false;
    }

    private int getDepth(TreeNode node, int x) {
        if (node == null) return 0;
        if (node.val == x) return 1;
        return Math.max(getDepth(node.left, x), getDepth(node.right, x)) + 1;
    }
}

