import java.util.Arrays;

public class Solution {
    public int stoneGameArray(int[] piles) {
        int n = piles.length;
        int[] prefixSum = new int[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + piles[i];
        }

        int[][] dp = new int[n][n];
        for (int i = 0; i < n; i++) {
            Arrays.fill(dp[i], Integer.MAX_VALUE);
        }
        dp[0][0] = 0;

        for (int i = 1; i < n; i++) {
            for (int j = Math.max(0, i - 2 * i); j <= i; j++) {
                int take = prefixSum[i + 1] - prefixSum[j];
                if (j > 0) {
                    take -= piles[j - 1];
                }
                dp[i][j] = Math.max(dp[i][j], take + (i < n - 1 ? dp[n - 1][i + 1] : 0));
            }
        }

        return dp[n - 1][0];
    }
}

