public class Solution {
    public int mctFromLeafValues(int[] arr) {
        int n = arr.length;
        int[][] dp = new int[n][n];
        for (int i = 0; i < n; i++) {
            dp[i][i] = Integer.MAX_VALUE;
        }
        for (int len = 1; len <= n; len++) {
            for (int i = 0; i + len - 1 < n; i++) {
                int j = i + len - 1;
                if (len == 1) {
                    dp[i][j] = 0;
                } else {
                    int min = Integer.MAX_VALUE;
                    for (int k = i; k <= j; k++) {
                        int val = arr[k];
                        int left = (i > 0) ? dp[i][k - 1] : 0;
                        int right = (k < n - 1 && j < n - 1) ? dp[k + 1][j] : 0;
                        min = Math.min(min, val * (left + right));
                    }
                    dp[i][j] = min;
                }
            }
        }
        int res = 0;
        Deque<Integer> stack = new ArrayDeque<>();
        for (int i = n - 1; i >= 0; i--) {
            while (!stack.isEmpty() && arr[stack.peek()] > arr[i]) {
                int val = arr[stack.pop()];
                res += dp[stack.peek()][i];
            }
            stack.push(i);
        }
        return res;
    }
}

