public class Solution {
    public int[] smallestSufficientTeam(String[] skills, List<List<String>> people) {
        Map<String, Integer> skillIndex = new HashMap<>();
        for (int i = 0; i < skills.length; i++) {
            skillIndex.put(skills[i], i);
        }

        int n = people.size();
        boolean[][] dp = new boolean[n][1 << skills.length];
        int[] res = new int[0];

        for (int mask = 0; mask < (1 << skills.length); mask++) {
            for (int i = 0; i < n; i++) {
                int personMask = 0;
                for (String skill : people.get(i)) {
                    if (((mask >> skillIndex.get(skill)) & 1) == 1) {
                        personMask |= 1 << skillIndex.get(skill);
                    }
                }
                if (!dp[i][personMask]) {
                    dp[i][personMask] = true;
                    for (int j = i; j < n; j++) {
                        int teamMask = mask | personMask;
                        boolean isSufficient = true;
                        for (String skill : skills) {
                            if (((teamMask >> skillIndex.get(skill)) & 1) == 0) {
                                isSufficient = false;
                                break;
                            }
                        }
                        if (isSufficient && res.length < i + j - i + 1) {
                            res = new int[i + j - i + 1];
                            for (int k = 0; k < i + j - i; k++) {
                                res[k] = people.get(k).get(0);
                            }
                        }
                    }
                }
            }
        }

