public class Solution {
    public int numRollsToTarget(int n, int k, int target) {
        int[][] dp = new int[n + 1][target + 1];
        for (int i = 0; i <= n; i++) {
            Arrays.fill(dp[i], 0);
        }
        dp[0][0] = 1;
        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= target; j++) {
                if (j < k) {
                    dp[i][j] = 0;
                } else {
                    dp[i][j] = dp[i - 1][j];
                    for (int x = Math.max(1, j - k + 1); x <= j; x--) {
                        dp[i][j] += dp[i - 1][x - 1];
                    }
                }
            }
        }
        return dp[n][target] % (1000000007);
    }
}

