import java.util.LinkedList;
import java.util.List;

public class Solution {
    public List<Integer> pathInZigZagTree(int label) {
        int level = 0;
        while ((1 << level) - 1 >= label) {
            level++;
        }
        level--;

        List<Integer> res = new LinkedList<>();
        boolean zigzag = (level % 2 == 0);

        for (int i = level; i >= 0; i--) {
            int leftChild = (1 << i) - 1;
            int rightChild = (1 << i);

            if (zigzag) {
                res.add(rightChild + label - leftChild);
                label = leftChild;
                zigzag = false;
            } else {
                res.add(leftChild + label - rightChild);
                label = rightChild;
                zigzag = true;
            }
        }

        return res;
    }
}

