        for (int i = 0; i < grid.length; i++) {
            for (int j = 0; j < grid[0].length; j++) {
                if (grid[i][j] == 1) {
                    int minSide = Math.min(Math.min(i, j) + 1, grid[0].length - j - 1);
                    while (minSide > maxSide && (i - minSide < 0 || j - minSide < 0 || i + minSide >= grid.length || j + minSide >= grid[0].length)) {
                        for (int k = i - minSide; k <= i + minSide; k++) {
