                        }
                        if (grid[i][j] == 1) {
                            minSide--;
                        } else {
                            break;
                        }
                    }
                    maxSide = Math.max(maxSide, minSide);
                }
            }
        }
        return (maxSide * 2 + 1) * (maxSide * 2 + 1);
    }
