                                if (edge[1] == newX && edge[0] == node[0]) {
                                    newColor = 0;
                                    break;
                                }
                            }

                            for (int[] edge : blueEdges) {
                                if (edge[1] == newX && edge[0] == node[0]) {
                                    newColor = 1;
                                    break;
                                }
                            }

                            queue.add(new int[]{newX, colors[newColor][1]});
                            answer[newX] = Math.min(answer[newX], node[1] + 1);
                        }
                    }
                }
            }
        }

        return answer;
    }
}

