public class Solution {
    public String alphabetBoardPath(String target) {
        List<String> moves = new ArrayList<>();
        int r = 0, c = 0;
        for (char ch : target.toCharArray()) {
            while (c < board[r].indexOf(ch)) {
                if (c == board[r].length()) {
                    r++;
                    c = 0;
                } else {
                    c++;
                    moves.add("R");
                }
            }
            while (r < board.indexOf(ch) / 5) {
                r++;
                moves.add("D");
            }
            while (r > board.indexOf(ch) / 5) {
                r--;
                moves.add("U");
            }
            while (c > board.indexOf(ch) % 5) {
                c--;
                moves.add("L");
            }
            if (ch != 'z') {
                r++;
                c = 0;
                moves.add("D");
            } else {
                moves.add("!");
            }
        }
        return String.join("", moves);
    }

    private static final String[][] board = {{"a", "b", "c", "d", "e"}, {"f", "g", "h", "i", "j"}, {"k", "l", "m", "n", "o"},
            {"p", "q", "r", "s", "t"}, {"u", "v", "w", "x", "y"}, {"z"}};
}

