public class Solution {
    public int[] maxDepthAfterSplit(String seq) {
        Stack<Integer> stack = new Stack<>();
        int[] result = new int[seq.length()];
        for (int i = 0; i < seq.length(); i++) {
            if (seq.charAt(i) == '(') {
                stack.push(i);
            } else if (seq.charAt(i) == ')') {
                int top = stack.pop();
                result[top] = 1;
                result[i] = 0;
            }
        }
        while (!stack.isEmpty()) {
            result[stack.pop()] = 1;
        }
        return result;
    }
}

