import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<List<Integer>> criticalConnections(int n, List<List<Integer>> connections) {
        List<List<Integer>> result = new ArrayList<>();
        int[] rank = new int[n];
        for (int i = 0; i < n; i++) {
            rank[i] = -1;
        }
        int time = 0;

        for (List<Integer> connection : connections) {
            int a = connection.get(0);
            int b = connection.get(1);

            if (rank[a] == -1 && rank[b] == -1) {
                dfs(connections, a, b, rank, time, result);
            }
        }

        return result;
    }

    private void dfs(List<List<Integer>> connections, int node, int parent, int[] rank, int time, List<List<Integer>> result) {
        if (rank[node] != -1) {
            return;
        }

        rank[node] = time;
        time++;

        for (List<Integer> connection : connections) {
            int a = connection.get(0);
            int b = connection.get(1);

            if ((a == node && b != parent) || (b == node && a != parent)) {
                int neiTime = rank[b];
                if (neiTime == -1) {
                    dfs(connections, b, node, rank, time, result);
                } else if (neiTime > rank[node]) {
                    result.add(Arrays.asList(a, b));
                }
            }
        }
    }
}

