import java.math.BigInteger;
import java.util.Arrays;

public class Solution {
    public int minNonZeroProduct(int p) {
        BigInteger[] nums = new BigInteger[2 * (int)Math.pow(2, p) - 1];
        for (int i = 0; i < nums.length; i++) {
            nums[i] = BigInteger.valueOf(i + 1);
        }

        Arrays.sort(nums);

        int product = 1;
        for (int i = 0; i < nums.length; i += 2) {
            if (!nums[i].testBit(0)) {
                break;
            }
            product *= nums[i];
        }

        return product.mod(new BigInteger("1000000007")).intValue();
    }
}

