import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int[] recoverArray(int n, int[] sums) {
        Map<Integer, Integer> map = new HashMap<>();
        for (int sum : sums) {
            if (!map.containsKey(sum)) {
                map.put(sum, 0);
            }
            map.put(sum, map.get(sum) + 1);
        }

        int[] ans = new int[n];
        Arrays.fill(ans, -1);

        for (Map.Entry<Integer, Integer> entry : map.entrySet()) {
            if (entry.getKey() > n * (n + 1) / 2) {
                break;
            }
            int targetSum = entry.getKey();
            int currentSum = 0;
            int left = 0;
            int right = n - 1;

            while (left <= right) {
                if (currentSum + ans[left] + ans[right] == targetSum) {
                    ans[left] = ans[right];
                    currentSum += 2 * ans[left];
                    left++;
                    right--;
                } else if (currentSum + ans[left] + ans[right] < targetSum) {
                    currentSum += ans[left];
                    left++;
                } else {
                    currentSum += ans[right];
                    right--;
                }
            }
        }

        return ans;
    }
}

