import java.math.BigInteger;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int numberOfUniqueGoodSubsequences(String binary) {
        BigInteger MOD = new BigInteger("1000000007");
        Map<String, BigInteger> dp = new HashMap<>();
        dp.put("", BigInteger.ONE);
        for (char c : binary.toCharArray()) {
            if (c == '0') {
                String prev = "";
                for (Map.Entry<String, BigInteger> entry : dp.entrySet()) {
                    String s = prev + "0";
                    dp.put(s, dp.getOrDefault(s, BigInteger.ZERO).add(entry.getValue()));
                }
            } else {
                String prev = "1";
                for (Map.Entry<String, BigInteger> entry : dp.entrySet()) {
                    String s = prev + "1";
                    dp.put(s, dp.getOrDefault(s, BigInteger.ZERO).add(entry.getValue()));
                }
            }
        }
        int res = 0;
        for (BigInteger value : dp.values()) {
            res += value.mod(MOD).intValue();
        }
        return res;
    }
}

