public class Solution {
    public int[] rearrangeArray(int[] nums) {
        Random random = new Random();
        int[] result = new int[nums.length];
        for (int i = 0; i < nums.length; i++) {
            if ((i % 2 == 0 && nums[i] <= nums[(i + 1) % nums.length]) || 
                (i % 2 != 0 && nums[i] >= nums[(i - 1 + nums.length) % nums.length])) {
                int j = random.nextInt(nums.length);
                while ((j % 2 == 0 && nums[j] <= nums[(j + 1) % nums.length]) || 
                       (j % 2 != 0 && nums[j] >= nums[(j - 1 + nums.length) % nums.length])) {
                    j = random.nextInt(nums.length);
                }
                result[i] = nums[j];
                nums[j] = Integer.MAX_VALUE;
            } else {
                result[i] = nums[i];
            }
        }
        return result;
    }
}

