public class Solution {
    public long maxMatrixSum(int[][] matrix) {
        int n = matrix.length;
        long sum = 0;
        int count = 0;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (matrix[i][j] > 0) {
                    sum += matrix[i][j];
                    count++;
                } else {
                    sum -= Math.abs(matrix[i][j]);
                }
            }
        }

        return sum + (count % 2 == 1 ? -Math.min(0, sum) : 0);
    }
}

