import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int maxCompatibilitySum(int[][] students, int[][] mentors) {
        Map<Integer, Integer> studentCount = new HashMap<>();
        for (int[] student : students) {
            int count = 0;
            for (int answer : student) {
                if (answer == 1) {
                    count++;
                }
            }
            studentCount.put(count, studentCount.getOrDefault(count, 0) + 1);
        }

        Map<Integer, Integer> mentorCount = new HashMap<>();
        for (int[] mentor : mentors) {
            int count = 0;
            for (int answer : mentor) {
                if (answer == 1) {
                    count++;
                }
            }
            mentorCount.put(count, mentorCount.getOrDefault(count, 0) + 1);
        }

        int maxCompatibilitySum = 0;
        for (Map.Entry<Integer, Integer> entry : studentCount.entrySet()) {
            for (Map.Entry<Integer, Integer> mentorEntry : mentorCount.entrySet()) {
                if (entry.getKey() == mentorEntry.getKey()) {
                    maxCompatibilitySum += entry.getValue() * mentorEntry.getValue();
                } else if (Math.abs(entry.getKey() - mentorEntry.getKey()) <= 1) {
                    int studentCount = entry.getValue();
                    int mentorCount = mentorEntry.getValue();
                    maxCompatibilitySum += Math.min(studentCount, mentorCount) * Math.max(studentCount, mentorCount);
                }
            }
        }

        return maxCompatibilitySum;
    }
}

